from telethon import TelegramClient
from telethon.tl.functions.account import UpdateProfileRequest
import asyncio
from datetime import datetime, timedelta
import os
import base64

# ÿßÿ∑ŸÑÿßÿπÿßÿ™ API ÿ¥ŸÖÿß
api_id = 26600960
api_hash = '73746434553a3b392291b51a49cd41fc'

# ⁄©ÿØ base64 ŸÅÿß€åŸÑ session ⁄©Ÿá ÿØÿ± GitHub ÿ¢ŸæŸÑŸàÿØ ⁄©ÿ±ÿØ€åÿØ
SESSION_BASE64 = """

"""

async def update_time():
    try:
        print("üü¢ Starting Telegram Live Clock...")
        
        # ÿß€åÿ¨ÿßÿØ ŸÅÿß€åŸÑ session ÿßÿ≤ base64 ÿß⁄Øÿ± Ÿàÿ¨ŸàÿØ ŸÜÿØÿßÿ±ÿØ
        if not os.path.exists('session_name.session'):
            print("üì¶ Creating session file from base64...")
            
            if SESSION_BASE64.strip() == "PASTE_THE_BASE64_CODE_HERE" or not SESSION_BASE64.strip():
                print("‚ùå Please replace SESSION_BASE64 with your actual base64 code")
                return
            
            try:
                # ÿ≠ÿ∞ŸÅ spaces Ÿà newlines ÿßÿ≤ ⁄©ÿØ base64
                clean_base64 = SESSION_BASE64.strip().replace('\n', '').replace(' ', '')
                
                # decode base64 Ÿà ÿß€åÿ¨ÿßÿØ ŸÅÿß€åŸÑ session
                session_data = base64.b64decode(clean_base64)
                
                with open('session_name.session', 'wb') as f:
                    f.write(session_data)
                
                file_size = os.path.getsize('session_name.session')
                print(f"‚úÖ Session file created! Size: {file_size} bytes")
                
            except Exception as decode_error:
                print(f"‚ùå Error decoding base64: {decode_error}")
                print("üìã Please check if the base64 code is complete and correct")
                return
        
        # ÿ®ÿ±ÿ±ÿ≥€å Ÿàÿ¨ŸàÿØ ŸÅÿß€åŸÑ session
        if os.path.exists('session_name.session'):
            file_size = os.path.getsize('session_name.session')
            print(f"üìÅ Using session file, Size: {file_size} bytes")
        else:
            print("‚ùå Session file not found after creation attempt")
            return
        
        async with TelegramClient('session_name', api_id, api_hash) as client:
            print("‚úÖ Connected to Telegram successfully!")
            
            stickers = ["üèìü•á", "üèìü•à", "üèìü•â"]
            sticker_index = 0
            
            while True:
                try:
                    # ÿ≤ŸÖÿßŸÜ ÿß€åÿ±ÿßŸÜ
                    utc_time = datetime.utcnow()
                    iran_time = utc_time + timedelta(hours=3, minutes=30)
                    current_time = iran_time.strftime('%H:%M')
                    current_sticker = stickers[sticker_index]
                    
                    display_name = f"{current_time} {current_sticker}"
                    
                    print(f"üîÑ Updating to: {display_name}")
                    
                    # ÿ®Ÿá ÿ±Ÿàÿ≤ÿ±ÿ≥ÿßŸÜ€å Ÿæÿ±ŸàŸÅÿß€åŸÑ
                    await client(UpdateProfileRequest(
                        first_name=display_name,
                        last_name=""
                    ))
                    
                    print(f'‚úÖ Updated: {display_name}')
                    
                    # ÿ™ÿ∫€å€åÿ± ÿßÿ≥ÿ™€å⁄©ÿ±
                    sticker_index = (sticker_index + 1) % len(stickers)
                    
                    await asyncio.sleep(60)
                    
                except Exception as e:
                    print(f'‚ùå Error: {e}')
                    await asyncio.sleep(60)
                    
    except Exception as e:
        print(f'üö® Critical Error: {e}')

if __name__ == "__main__":
    asyncio.run(update_time())
